import React, { useRef } from 'react'

export default function Search(props) {

    const {
        onGameSearch,
        gameString,
        gameNameRef
    } = props;  

    return (
        <div className="page-search">
            <form action="">
                <input ref={gameNameRef} id="game-filter" onChange={onGameSearch} value={gameString} type="text" className="name-search" placeholder="Search" />
                <button type="submit"><span className="icon-search"></span></button>
            </form>
        </div>
    )
}
